import React, {useState, useEffect} from "react"
import {
  Switch,
  Route
} from "react-router-dom";
import Home from "./components/Home"
import Main from "./components/Main"
import AuthenticationDataService from "./services/authentication"

function App() {  

  const [accountInfo,setAccountInfo] = useState("unChecked");

  useEffect(()=>{
    getAuthenticated();
  },[])

  const getAuthenticated = () =>{
    AuthenticationDataService.getAuthenticatedUser()
        .then(res =>{
            setAccountInfo(res.data || "not authenticated"); 
        }) 
        .catch(e =>{
            console.log(e)
        }) 
  }   

  return (
    <Switch>
      <Route path={["/","/home"]}>
        <Home accountInfo={accountInfo}/>
      </Route>
      <Route path="/main">
        <Main accountInfo={accountInfo}/>
      </Route>
    </Switch>
  );
}

export default App;
